const url = 'https://yalantis-react-school-api.yalantis.com/api/task0/users';

const options = {
    method:'GET',
    headers:{
        'Content-Type':'application/json; charset=utf-8'
    }
}

fetch(url, options)
.then(response => response.json())
    .then(data => {
        console.log(data)
    })
